import React from 'react';
const mathLib = require('./mathLib.js')
// import mathLib from './mathLib'; 
let alpha

export default class Container extends React.Component {
	constructor(props){
		super(props)

 		var line_resp1 = 100
 		var parameter = 0.1

  		let parameters = mathLib.linspacee(0, 1, line_resp1, 0)
  		console.log(parameters)

   		alpha = 0.025464790894703267 - 0.016976527263135505*Math.cos((4*Math.PI*parameter)) - 0.0033953054526271037*Math.cos(8*Math.PI*parameter) 
      			- 0.040000000000000036*Math.sin((2*Math.PI*parameter)) + 2.7305908429669844e-18*Math.sin((4*Math.PI*parameter)) - 1.734723475976807e-18*Math.sin((6*Math.PI*parameter))
      			- 1.843267981421152e-18*Math.sin((8*Math.PI*parameter)) + 8.673617379884035e-19*Math.sin((10*Math.PI*parameter))

	}

 	render() {

 	return alpha
  	}
}
